  render() {
    return (
      <div className="uk-position-center uk-overlay uk-overlay-default">
        <article className="uk-article uk-width-2-3@s uk-width-1-3@m uk-row-first uk-align-center uk-margin-large-bottom">
          <div className="uk-width-1-1 uk-row-first uk-margin-large-bottom">
            <p className=" uk-heading-small">Hi, I'm Dan.</p>
          </div>

          <p className="uk-text-justify">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
